import styled from "styled-components";

export const Main=styled.div`
padding-top:6rem;
text-align:center;
`
export const Head=styled.div`
font-weight:700;
font-size: 4.2vw;
color:#fff;
text-align:center;
padding-top:2rem;
`
export const Button=styled.button`
color:#fff;
background:green;
font-size:.8rem;
border:none;
border-radius:.2rem;
padding:.2rem

`
